hwt.bodyText:
If((clk)._onRisingEdge(),
    If(rst_n._eq(0x0),
        readRegEmpty(0x1),
        readDataPending(0x0),
    ).Else(
        readRegEmpty(readRegEmpty_next),
        readDataPending(readDataPending_next),
    ),
)

If((clk)._onRisingEdge(),
    If(rst_n._eq(0x0),
        readRegEmpty(0x1),
        readDataPending(0x0),
    ).Else(
        readRegEmpty(readRegEmpty_next),
        readDataPending(readDataPending_next),
    ),
)

If(insertFsm._eq(insertFsm_t.idle),
    If(clean_vld,
        insertFsm_next(insertFsm_t.cleaning),
    ).Elif(insert_vld | lookup_vld | delete_vld,
        insertFsm_next(insertFsm_t.lookup),
    ).Else(
        insertFsm_next(insertFsm),
    ),
).Elif(insertFsm._eq(insertFsm_t.cleaning),
    If(cleanupAddr._eq(32 - 1.auto_cast(Bits(5, signed=False))),
        insertFsm_next(insertFsm_t.idle),
    ).Else(
        insertFsm_next(insertFsm),
    ),
).Elif(insertFsm._eq(insertFsm_t.lookup),
    If(sig_tables_0_lookup_rd & sig_tables_1_lookup_rd,
        insertFsm_next(insertFsm_t.lookupResWaitRd),
    ).Else(
        insertFsm_next(insertFsm),
    ),
).Elif(insertFsm._eq(insertFsm_t.lookupResWaitRd),
    If(sig_tables_0_lookupRes_vld & sig_tables_1_lookupRes_vld,
        insertFsm_next(insertFsm_t.lookupResAck),
    ).Else(
        insertFsm_next(insertFsm),
    ),
).Else(
    If(lookupOrigin._eq(0x2),
        insertFsm_next(insertFsm_t.idle),
    ).Elif((lookupOrigin._eq(0x1)) & (lookupRes_rd._eq(0x1)),
        insertFsm_next(insertFsm_t.idle),
    ).Elif((~lookupOrigin._eq(0x1)) & ((sig_tables_0_insert_rd & sig_tables_1_insert_rd)._eq(0x1)) & (insertFinal._eq(0x1)),
        insertFsm_next(insertFsm_t.idle),
    ).Elif((~lookupOrigin._eq(0x1)) & ((sig_tables_0_insert_rd & sig_tables_1_insert_rd)._eq(0x1)) & ((~insertFinal)._eq(0x1)),
        insertFsm_next(insertFsm_t.lookup),
    ).Else(
        insertFsm_next(insertFsm),
    ),
)

If(lookupResRead & sig_tables_0_lookupRes_vld & sig_tables_1_lookupRes_vld,
    If(sig_tables_0_lookupRes_found | sig_tables_1_lookupRes_found,
        targetOH_next(Concat(sig_tables_1_lookupRes_found, sig_tables_0_lookupRes_found)),
    ).Elif(~sig_tables_0_lookupRes_occupied,
        targetOH_next(0x1),
    ).Elif(~sig_tables_1_lookupRes_occupied,
        targetOH_next(0x2),
    ).Elif(targetOH,
        targetOH_next(Concat(sig_, sig_)),
    ).Else(
        targetOH_next(0x2),
    ),
    insertFinal_next(sig_tables_0_lookupRes_found | sig_tables_1_lookupRes_found | (~sig_tables_0_lookupRes_occupied) | (~sig_tables_1_lookupRes_occupied)),
).Else(
    targetOH_next(targetOH),
    insertFinal_next(insertFinal),
)

If((clk)._onRisingEdge(),
    If(rst_n._eq(0x0),
        insertFsm(insertFsm_t.idle),
        cleanupAddr(0x0),
    ).Else(
        insertFsm(insertFsm_next),
        cleanupAddr(cleanupAddr_next),
    ),
)
